sys_variable_value.value:
(function execute(inputs, outputs) {
  var cfy_integration = new cloudify_integration();
  // convert labels array object to array of dicts
  var bp_labels = '';
  for (var i = 0; i < inputs.labels.length; i++) {
    var label = inputs.labels[i];
    if (label.label_name!='' && label.label_value!= ''){
      bp_labels += label.label_name + '=' + label.label_value ;
      if(i<inputs.labels.length-1)
        bp_labels += ',';
      /*var bp_label = {}
      bp_label[label.label_name] = label.label_value;
      bp_labels.push(bp_label);*/
    }
  }
  outputs.result = JSON.stringify(cfy_integration.uploadBlueprint(inputs.config_name, inputs.blueprint_id, inputs.application_file_name, inputs.visibility, inputs.blueprint_archive_url, inputs.blueprint_archive, bp_labels));


})(inputs, outputs);

